import React from "react";
import Header from "../Header/Header";
import "./Profile.css";

const Profile = () => {
  return (
    <div>
      <Header />
      <div className="profile-section">
        <div className="profile-title">
          <p>Profile</p>
        </div>
      </div>
    </div>
  );
};

export default Profile;
